pragma solidity 0.8.10;

library PriceHelper {

    function sortAndSplit(uint256[] memory arr) internal pure returns (uint256[] memory, uint256[] memory) {
        // find the minimum and maximum elements in the array
        uint256 minValue = arr[0];
        uint256 maxValue = arr[0];
        for (uint256 i = 1; i < arr.length; i++) {
            if (arr[i] < minValue) {
                minValue = arr[i];
            } else if (arr[i] > maxValue) {
                maxValue = arr[i];
            }
        }

        // create a new array to count the occurrences of each element
        uint256[] memory counts = new uint256[](maxValue - minValue + 1);

        // iterate through the array and count the occurrences of each element
        for (uint256 i = 0; i < arr.length; i++) {
            counts[arr[i] - minValue]++;
        }

        // create two new arrays to hold the unique elements and their counts
        uint256[] memory uniqueArr = new uint256[](arr.length);
        uint256[] memory countArr = new uint256[](arr.length);
        uint256 uniqueCount = 0;

        // iterate through the counts array and populate the new arrays
        for (uint256 i = 0; i < counts.length; i++) {
            if (counts[i] > 0) {
                uniqueArr[uniqueCount] = i + minValue;
                countArr[uniqueCount] = counts[i];
                uniqueCount++;
            }
        }

        // create two new arrays with length equal to uniqueCount
        uint256[] memory resultArr = new uint256[](uniqueCount);
        uint256[] memory resultCountArr = new uint256[](uniqueCount);

        // copy the unique elements and their counts into the new arrays
        for (uint256 i = 0; i < uniqueCount; i++) {
            resultArr[i] = uniqueArr[i];
            resultCountArr[i] = countArr[i];
        }

        return (resultArr, resultCountArr);
    }
}
